(15, '1. Temos um total de 717 clientes na nossa base de dados; \n2.Temos 686 clientes activos;\n3.Temos um total de 33 clientes desactivados devido a falta de pagamentos das facturas;\n4.Temos um total de 666 clientes facturados e um volume de 6767m3 tivemos um acréscimo no volume facturado;\n5. Temos um total de 20 clientes nao facturados devido a demora na ligação isso atrasa muito o processo de facturação.', 'Orlando Domingos Nhadumbuque', 7, 2022, '2022-08-12 10:33:08'),
(25, 'Temos um total de 733 clientes cadastrados na Base de dados;\nTemos 703 clientes activos das quais 668 foram facturados;\nTemos um total 30 cliente desactivados;\nTemos um total de 35 clientes não facturados e destes 22 são novos clientes;\nVolume de água facturada 7224m3.\n', 'Orlando Domingos Nhadumbuque', 8, 2022, '2022-09-15 11:26:11'),
(35, 'Relatorio de exercicio de 2021 a 2022 sobre os custos  financeiros. De referir que este reletorio e o espelho recebimentos e divida do Sistema', 'Mara Moiane', 8, 2021, '2022-10-25 12:02:19'),
(45, 'Temos um total de 735 clientes na nossa bade de dados,\nTemos um total de 704 clientes activos dos quais foram facturados 672.\nForam desactivados 31 clientes por falta de pagamento das facturas e 29 clientes não foram facturados. \nTemos 13 ligações novas.\n', 'Orlando Domingos Nhadumbuque', 9, 2022, '2022-11-02 07:58:35'),
(55, 'Temos um Total de 743 clientes na base de dados e temos 31 desactivados;\nTemos total de 712 clientes activos e 16 clientes novos;\nTemos um total de 696 clientes facturados;\nVolume Facturado 7629m3; \n', 'Orlando Domingos Nhadumbuque', 10, 2022, '2022-11-09 13:57:42'),
(65, 'Temos um total de 759 clientes na base de dados;\nTemos um total de 723 clientes activos;\nTemos um total de 36 desativados;\nFacturamos 695 clientes;\nVolume facturado 5376m3;\n', 'Orlando Domingos Nhadumbuque', 11, 2022, '2022-12-23 14:25:06'),
(75, 'Temos um total de 768 na base de dados;\nTemos um total de 726 clientes activos;\nTemos um total de 42 clientes desativados;\nTotal de clientes facturados 710 clientes;\nVolume de Agua facturada 6412m3.', 'Orlando Domingos Nhadumbuque', 0, 2023, '2023-01-13 13:46:53'),
(85, 'Temos um Total de 779 Clientes na base de dados;\nTemos 725 activos;\nTemos um total de 54 desactivados;\nFacturamos 703 Clientes;\nTotal de 10 clientes não Facturados \nVolume Facturado 7435m3\n', 'Orlando Domingos Nhadumbuque', 1, 2023, '2023-02-16 09:04:47');
